import {
  GraphQLObjectType,
  GraphQLSchema,
  GraphQLString,
  GraphQLList,
} from 'graphql';

import * as models from './models';
import KorisnikType from './types/korisnikType';

const RootQueryType = new GraphQLObjectType({
  name: 'RootQueryType',
  fields: {
    korisnik: {
      type: KorisnikType,
      args: {
        key: {
          type: GraphQLString,
        },
      },
      resolve(obj, args, { database }) {
        return models.Korisnik(database).getAll(obj, args, database);
      },
    },
  },
});

const schema = new GraphQLSchema({
  query: RootQueryType,
  // mutation: ...
});

module.exports = schema;

