import {
  GraphQLObjectType,
  GraphQLID,
  GraphQLString,
  GraphQLNonNull,
  GraphQLList,
} from 'graphql';

import ulogaType from './ulogaType';
import databaseAPI from '../databaseAPI';

module.exports = new GraphQLObjectType({
  name: 'KorisnikType',
  fields: () => ({
    id: { type: GraphQLNonNull(GraphQLID) },
    ime: { type: GraphQLString },
    prezime: { type: GraphQLString },
    datumRodenja: {
      type: GraphQLString,
      resolve: obj => obj.datum_rodenja,
    },
    uloga: {
      type: ulogaType,
      resolve: (obj, args, { database }) => databaseAPI(database).getUloga(obj),
    },
  }),
});

