import {
  GraphQLObjectType,
  GraphQLSchema,
  GraphQLString,
  GraphQLList,
} from 'graphql';

import * as models from './models';
import KorisnikType from './types/korisnikType';
import UlogaType from './types/ulogaType';
import KategorijaType from './types/kategorijaType';
import UredajType from './types/uredajType';
import ZahtjevPosudbeType from './types/zahtjevPosudbeType';

const RootQueryType = new GraphQLObjectType({
  name: 'RootQueryType',
  fields: {
    korisnik: {
      type: GraphQLList(KorisnikType),
      args: {
        key: {
          type: GraphQLString,
        },
      },
      resolve(obj, args, { database }) {
        return models.Korisnik.getAll(obj, args, database);
      },
    },
    uloga: {
      type: GraphQLList(UlogaType),
      args: {
        key: {
          type: GraphQLString,
        },
      },
      resolve(obj, args, { database }) {
        return models.Uloga.getAll(obj, args, database);
      },
    },
    kategorija: {
      type: GraphQLList(KategorijaType),
      args: {
        key: {
          type: GraphQLString,
        },
      },
      resolve(obj, args, { database }) {
        return models.Kategorija.getAll(obj, args, database);
      },
    },
    uredaj: {
      type: GraphQLList(UredajType),
      args: {
        key: {
          type: GraphQLString,
        },
      },
      resolve(obj, args, { database }) {
        return models.Uredaj.getAll(obj, args, database);
      },
    },
    zahtjevPosudbe: {
      type: GraphQLList(ZahtjevPosudbeType),
      args: {
        key: {
          type: GraphQLString,
        },
      },
      resolve(obj, args, { database }) {
        return models.ZahtjevPosudbe.getAll(obj, args, database);
      },
    },
  },
});

const schema = new GraphQLSchema({
  query: RootQueryType,
  // mutation: ...
});

module.exports = schema;

