            stanje_id: 1
        }).then(res => database.select().from('uredaj').where({ id: res[0] }).then(res => humps.camelizeKeys(res[0])));
    } else {
        return await database('uredaj').insert({
            naziv_uredaja: nazivUredaja,
            serijski_broj: serijskiBroj,
            cijena,
            napomena,
            specifikacije,
            kategorija_id: kategorijaId,
            slika_url: null,
            stanje_id: 1
        }).then(res => database.select().from('uredaj').where({ id: res[0] }).then(res => humps.camelizeKeys(res[0])));
    }

};

